import React, { useEffect, useState, useContext } from "react";
import { AuthContext } from "../../contexts/AuthContext";
import { Button, Modal, Table } from "react-bootstrap";
import DeleteSchedule from "../Delete/DeleteSchedule";
import axios from "axios";
import EditSchedule from "../Edit/EditSchedule";
import "../../index.css";
import { jsPDF } from "jspdf";
import 'jspdf-autotable'
import html2canvas from 'html2canvas';


function ScheduleListOfUser() {
  const { user1, isAuth } = useContext(AuthContext);
  const [schedule, setSchedule] = useState([]);
  const [order, setOrder] = useState("date");
  const URL_GET_USER = `http://localhost:8000/api/v1/schedulesbyuser/${user1.id}/${user1.id}`;
  const [show, setShow] = useState(false);
  const [noteonmodal, setNoteonmodal] = useState("");
  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  useEffect(() => {
    axios
      .get(URL_GET_USER, {
        headers: {
          Authorization: `Bearer: ${localStorage.getItem("app_token")}`,
        },
      })
      .then((data) => setSchedule(data.data))
      .catch((err) => console.log(err));
  }, []);

  const sortJSON = (json, key, orden) => {
    return json.sort(function (a, b) {
      var x = a[key],
        y = b[key];

      if (orden === "asc") {
        return x < y ? -1 : x > y ? 1 : 0;
      }

      if (orden === "desc") {
        return x > y ? -1 : x < y ? 1 : 0;
      }
    });
  };

  sortJSON(schedule, order, "asc");

  const pdf = () => {
      const doc = new jsPDF();
      const text = "Mis Citas"
      const img = "data:image/jpeg;base64,"

// Or use javascript directly:
doc.autoTable({
  margin: { top: 50 },
  head: [['Fecha', 'Hora', 'Nombre Dr.', 'Apellido Dr.']],
  body: [
    ['David', 'david@example.com', 'Sweden', 'Sweden'],
  ],
})
    doc.text(text, 20, 30);
    doc.addImage(img, "JPEG", 160, 15, 20, 20);
    doc.save("Prueba.pdf");
  
    };

    

  return (
    <>
      {isAuth ? (
        user1.role === "user" ? (
          <>
          <Button onClick={pdf}>PDF</Button>
            <Table responsive hover size="sm">
              <thead>
                <tr>
                  <th onClick={() => setOrder("date")} variant="link" size="sm">
                    Fecha
                  </th>
                  <th onClick={() => setOrder("time")} variant="link" size="sm">
                    {" "}
                    Hora
                  </th>
                  <th
                    onClick={() => setOrder("first_name")}
                    variant="link"
                    size="sm"
                  >
                    Nombre Dr.
                  </th>
                  <th
                    onClick={() => setOrder("last_name")}
                    variant="link"
                    size="sm"
                  >
                    Apellido Dr.
                  </th>
                  <th>Nota</th>
                  <th>Editar</th>
                  <th>Cancelar</th>
                </tr>
              </thead>
              <tbody>
                {schedule.map((date, i) => {
                  const fecha = new Date(date.date).valueOf();
                  const now = Date.now();
                  return fecha >= now ? (
                    <tr key={i}>
                      <td>{date.date.split("T")[0]}</td>
                      <td>{date.time}</td>
                      <td>{date.doctor[0].first_name}</td>
                      <td>{date.doctor[0].last_name}</td>
                      <td>
                        {
                          <Button
                            variant="warning"
                            onClick={() => (
                              handleShow(), setNoteonmodal(date.note)
                            )}
                          >
                            <i className="far fa-sticky-note"></i>
                          </Button>
                        }
                      </td>
                      <td>
                        {
                          <EditSchedule
                            id={date._id}
                            datee={date.date}
                            timee={date.time}
                            notee={date.note}
                            doctore={date.doctor[0]._id}
                            doctorefn={date.doctor[0].first_name}
                            doctoreln={date.doctor[0].last_name}
                          />
                        }
                      </td>
                      <td>
                        <DeleteSchedule id={date._id} />
                      </td>
                    </tr>
                  ) : undefined;
                })}
              </tbody>
            </Table>
            <Modal show={show} onHide={handleClose}>
              <Modal.Header closeButton>
                <Modal.Title>Nota</Modal.Title>
              </Modal.Header>
              <Modal.Body>{noteonmodal}</Modal.Body>
            </Modal>
          </>
        ) : undefined
      ) : undefined}
    </>
  );
}

export default ScheduleListOfUser;
